This approach ensures that the order of items in the queue is maintained as they were added, since `stack1` operates on a Last-In-First-Out (LIFO) basis and `stack2` effectively reverses that order when dequeuing. The space complexity of this implementation is O(n), where n is the number of items in the queue, because each item needs to be stored in one of the two stacks at any given time.
